script: |
  super -f text -I q3339.spq | sort > q3339.out

inputs:
  - name: q3339.spq
    data: |
      SELECT col2 - + col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 + + - col1 * - col0 NOT BETWEEN NULL AND ( + ( + 66 ) + - 59 + - col2 );
  - name: tab2

outputs:
  - name: q3339.out
    data: |
